import styles from "./PageNav.module.css";
import Logo from "./Logo";

function PageNav() {
    return (
        <nav className={styles.nav}>
        <Logo />
            <ul>
                <li>
                    <NavLink to="product" />
                </li>
                <li>Pricing</li>
                <li>Login</li>
            </ul>
        </nav>
    )
}

export default PageNav;
